<!doctype html>
<html>
<head>
    <meta charset="utf-8">
    <title>Fine invoice</title>
    
    <style>
    .invoice-box {
        max-width: 800px;
        margin: auto;
        padding: 30px;
        border: 1px solid #eee;
        box-shadow: 0 0 10px rgba(0, 0, 0, .15);
        font-size: 16px;
        line-height: 24px;
        font-family: 'Helvetica Neue', 'Helvetica', Helvetica, Arial, sans-serif;
        color: #555;
    }
    
    .invoice-box table {
        width: 100%;
        line-height: inherit;
        text-align: left;
    }
    
    .invoice-box table td {
        padding: 5px;
        vertical-align: top;
    }
    
    .invoice-box table tr td:nth-child(2) {
        text-align: right;
    }
    
    .invoice-box table tr.top table td {
        padding-bottom: 20px;
    }
    
    .invoice-box table tr.top table td.title {
        font-size: 45px;
        line-height: 45px;
        color: #333;
    }
    
    .invoice-box table tr.information table td {
        padding-bottom: 40px;
    }
    
    .invoice-box table tr.heading td {
        background: #eee;
        border-bottom: 1px solid #ddd;
        font-weight: bold;
    }
    
    .invoice-box table tr.details td {
        padding-bottom: 20px;
    }
    
    .invoice-box table tr.item td{
        border-bottom: 1px solid #eee;
    }
    
    .invoice-box table tr.item.last td {
        border-bottom: none;
    }
    
    .invoice-box table tr.total td:nth-child(2) {
        border-top: 2px solid #eee;
        font-weight: bold;
    }
    
    @media only screen and (max-width: 600px) {
        .invoice-box table tr.top table td {
            width: 100%;
            display: block;
            text-align: center;
        }
        
        .invoice-box table tr.information table td {
            width: 100%;
            display: block;
            text-align: center;
        }
    }
    
    /** RTL **/
    .rtl {
        direction: rtl;
        font-family: Tahoma, 'Helvetica Neue', 'Helvetica', Helvetica, Arial, sans-serif;
    }
    
    .rtl table {
        text-align: right;
    }
    
    .rtl table tr td:nth-child(2) {
        text-align: left;
    }
    </style>
</head>

<body>
    <div class="invoice-box">
        <table>
            <tr class="top">
                <td colspan="3">
                    <table>
                        <tr>
                            <td class="title">
                                <img src="data:image/jpeg;base64,">
                          
                            </td>
                            
                            <td>
                                Fine Invoice number: {{ $fine->id }}<br>
                                Fine issued: {{ $fine->created_at}}<br>
                                Generated: {{ date("D M j Y") }} <br>
                                To: {{ $inhabitant->name}} {{ $inhabitant->surname}} <br>
                                Personal code: {{ $inhabitant->personal_code}}
                            </td>
                        </tr>
                    </table>
                </td>
            </tr>
            
            <tr class="information">
                <td colspan="3">
                    <table>
                        <tr>
                            <td>
                                LiepuNams<br>
                                Someaddress Street 46,<br>
                                Sometown, Latvia
                            </td>
                            
                            <td>
                               Management company<br>
                               Alex Leontyev<br>
                               ragingtigerrt@gmail.com
                            </td>
                        </tr>
                    </table>
                </td>
            </tr>
            
            <tr class="heading">
                <td>
                    Fine reason
                </td>
                
                <td>
                    Reason description                
                </td>
                <td>
                    Sum to pay                 
                </td>
            </tr>
            
            <tr class="details">
                <td>
                    {{ $reason->name }}
                </td>
                
                <td>
                    {{ $reason->description }}
                </td>
                
                <td>
                    {{ $fine->sum }} EUR
                </td>
            </tr>
            
           
            <tr class="total">
                <td></td>
                <td></td>
                <td>
                   Total: {{ $fine->sum }} EUR
                </td>
            </tr>
            <tr>
                <td></td>
                <td></td>
                <td>
                Accounts to pay to: 
                IBAN: LV48UNLA1234432155789	
                </td>
            </tr>

            
        </table>
    </div>
</body>
</html>
